import styled from "styled-components";
const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding-top: 5rem;
  background-color: aliceblue;
  width: 100%;
  height: calc(100vh - 5rem);
  flex-direction: column;
`;

function Event() {
  return <Container></Container>;
}

export default Event;
